import React from 'react';
function CreateTicketSection() {
    return (
        <div className='container'>
            <div className='row p-5'>
                <div className='col-8'>
                    <select class="form-select input-group-text" aria-label="Default select example" id="inputGroup-sizing-lg" >
                        <option selected>Open this select menu</option>
                        <option type="text">One</option>
                        <option type="text">Two</option>
                        <option type="text">Three</option>
                    </select>
                    <div class="input-group input-group-lg">
                        <span class="input-group-text" id="inputGroup-sizing-lg">Large</span>
                        <input type="text" class="form-control" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-lg"/>
                    </div>
                </div>
                <div className='col-4'></div>
            </div>
        </div>
    );
}

export default CreateTicketSection;
